//www.visitstmarysmd.com/">St. Mary's County, MD</a> about 60 miles south of Washington, D.C.<br/></br>The event is held at the St. Mary's County Governmental Center. The nearest address to the Start/Finish line is <a href='https://www.google.com/maps/place/23110+Leonard+Hall+Dr,+Leonardtown,+MD+20650/@38.3032192,-76.6301947,93m/data=!3m1!1e3!4m13!1m7!3m6!1s0x89b765e2aa731597:0x12a3f17b44982415!2s23110+Leonard+Hall+Dr,+Leonardtown,+MD+20650!3b1!8m2!3d38.3029279!4d-76.6294411!3m4!1s0x89b765e2aa731597:0x12a3f17b44982415!8m2!3d38.3029279!4d-76.6294411'>23110 Leonard Hall Drive, Leonardtown, MD 20650</a><br/><iframe src='https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d405.2441745317022!2d-76.63019465064968!3d38.30321915694067!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89b765e2aa731597%3A0x12a3f17b44982415!2s23110+Leonard+Hall+Dr%2C+Leonardtown%2C+MD+20650!5e1!3m2!1sen!2sus!4v1510018636785' width='600' height='450' frameborder='0' style='border:0' allowfullscreen></iframe>`},{question:"How do I join/form a team?",answer:"Anyone can form a team.  It's as simple as getting friends, family or co-workers together and designating/indicating a team name on the entry form."},{question:"Can I bring my dog to walk or run with me?",answer:"Yes. Well behaved dogs on leashes are permitted."},{question:"Are baby strollers/joggers allowed in the run or fun walk?",answer:"Yes."},{question:'Will "same day" registration be available?',answer:"Pre-Registration is recommended and most popular, but same day registration is available from 7:00 a.m. - 8:00 a.m."},{question:"What if it rains on race day?",answer:'The Run and Fun Walk will be held "Rain or Shine".'},{question:"How long does it take to get race results and how/where can I get a copy?",answer:"Race results are announced after completion of the race. Awards will be presented at that time. Race results will be posted on this web site within 24 hours."},{question:"Can my small child walk with me free or do I have to pay to register him/her?",answer:"Children 6 and under are permitted free. (Parents or legal guardians must sign a waiver releasing Hospice and all event sponsors)."},{question:"I pre-registered, how do I get my race packet?",answer:"Race packet pickup is available on the Friday before Race Day from 9am - 5pm at the Wellness and Aquatics Center on the CSM Leonardtown Campus located at 22950 Hollywood Road Leonardtown, MD 20650."},{question:"What time should I arrive?",answer:"We encourage everyone to arrive early. Race day registration begins at 7:00 a.m. Please arrive no later than 8:00 a.m. to pick up your race packet."},{question:"Where do I park?",answer:"Parking is available at the Governmental Center and at St. Mary's Hospital. <strong>PLEASE CARPOOL</strong> if possible. Reducing the amount of traffic in and around the Governmental Center will increase the efficiency and safety of the race."},{question:"Do you offer bag check?",answer:"No, All parking is within walking distance of the start line."},{question:"If I register and get hurt/injured or can't participate.  Can I defer my entry or get a refund?",answer:"We have a no refund policy and do not offer deferrals."}],Er=["Jim Dicus","Laurie Lawrence","Jennifer Overstreet","Jamie Thomas","Jeff Thomas","Emily Cantrell-Stagner","Jeannette Wolter","Aaron Okun","Brook Fallon"],Rr=["“Whammy” Tammie Wood","Alan Wible","Alan Wible","Alex Shellhammer","Alex Shellhammer","Alex Shellhammer","All my loved ones!!","All of my Hospice House Patients","Alma Johnson ","Alma Johnson, I miss you dearly mom","Angeline and Vito Busco ","Ann & Tommy Poe, Shirley Nickerson, Thelma Schrader, Missy Albert, Brent Robrecht ","Anne Rezny","Annette Marie Gisoldi","Arnie Huber, John Bowles and Alberta Bowles","Audrey Tecu","Audrey Turbyne, Hilda Mattingly, Martha Fischer, Shirley Nickerson, Scot Mattingly","Barbara “Reds” Gasiewicz","Barbara “Reds” Gasiewicz","Barbara Grubaugh (Mom) ","Barbara J Verdel","Barbra and Richard Shivers 2nd","